import React from 'react';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity} from 'react-native';
import { RadioButton } from 'react-native-paper';
import Icon2  from 'react-native-vector-icons/AntDesign';
import styled from 'styled-components/native';


const StyledCard1= styled.Image`
width: 85.33px;
height: 48px;
border: 1px solid #000000;
filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
`;

const CardView= styled.Image`
flex-direction: row;
align-items: center;
justify-content: space-between;
`;



export default function Ecommerce8({navigation}){
	return(
		<SafeAreaView>
		<Text>Saved Cards</Text>
		<View><StyledCard1 source={require('../assets/card1.png')}/><StyledCard1 source={require('../assets/card2.png')}/><StyledCard1 source={require('../assets/card3.png')}/></View>
		</SafeAreaView>
		)
}
